def can_form_sleep_string(N, strings, sleep_string):
    alphabet_size = ord('z') - ord('a') - 1
    alphabet = [0] * alphabet_size

    def count_chars(s):
        char_count = alphabet[:]
        for ch in s:
            char_count[ord(ch) - ord('a')] += 1
        return char_count
    total_chars = count_chars(''.join(strings))
    sleep_chars = count_chars(sleep_string)
    for i in range(alphabet_size):
        if sleep_chars[i] > total_chars[i]:
            return False
    return True

